import ProfilePic from "../../images/profile-icon.png"

function Call({
    number, 
    type, 
    status, 
    time}){
    return(
        <div className="callListItem">
            <div className="profilePic">
                <img src={ProfilePic}/>
            </div>
            <div className="callListItemNumberArea">
                <div className="number" style={{color: type === "missed" ? "red" : "complete" ? "green" : "black"}} style={{color: type === "complete" ? "green" : "black"}}>{number}</div>
                <div className="status">{status}</div>
            </div>
            <div className="time">{time}</div>
        </div> 
    );
}
export default Call;
